def main():
    s = ''
    print(removeDup(s))


def removeDup(s: str) -> str:
    answer = []

    for letter in s:
        if len(answer) > 1:
            print(answer[-1])
        if len(answer) > 0 and answer[-1] == letter:
            answer.pop()
        else:
            answer.append(letter)
    return("".join(answer))


if __name__ == '__main__':
    main()
